import Layout from "../components/Layout/";
import { ContactWrapper } from "../components/ContactMe/styles";
import ContactForm from "../components/ContactMe/contact-form";

const Contact = () => (
	<Layout>
		<ContactWrapper>
			<div>
				<ContactForm />
			</div>
			<div>2nd half</div>
		</ContactWrapper>
	</Layout>
);

export default Contact;
